%[text] %[text:anchor:T_F2281A6D] # Image Enhancement and Filtering
%[text] Image enhancement is the process of adjusting digital images so that the results are more suitable for display or further [image analysis](https://www.mathworks.com/discovery/image-analysis.html). For example, you can brighten an image, sharpen, or remove noise, making it easier to [identify key features](https://www.mathworks.com/help/images/pixel-values-and-image-statistics.html).
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] %[text:anchor:T_EA3F08D5] # Contrast Adjustment
%[text] For the following examples, we will open the xray-head.png image. If prompted, choose the UNIT 1 data folder
clearvars
close all
mmSetUnitDataFolder(1)
img = imread("xray-head.png");
%%
%[text] %[text:anchor:H_B7DD8D6A] ## Display image and histogram
%[text] The function **mmShowHist** is a function that I wrote to display the image and its histogram in the same figure. This function is part of the Muddling Through MATLAB course functions (MtMfns). 
fh = figure;
mmShowHist(img)
%%
%[text] Most of the Mastering MATLAB functions start with the prefix mm. You can bring up the help for these functions as follows
help mmShowHist
%%
%[text] %[text:anchor:H_E180C97A] ## Global Pixel Intensity Variation 
%[text] So, what do you think will happen to an image's histogram if we add 50 to all of the pixel intensities in the  image? Or if we subtract 50?
figure % reset figure

%Set the slider to a value you want to add (or subtract) from img
pixel_shift = 0; %[control:slider:4121]{"position":[15,16]}
img_bright = img + pixel_shift;

% display the brightened moon
mmShowHist(img_bright) % display image and histogram

% adjust limits to show the whole histogram
xlim([-2 257]);
ylim([0 6e4]);

% Contrast
Imax = double(max(img_bright(:)));
Imin = double(min(img_bright(:)));
C = (Imax-Imin) / (Imax+Imin); % contrast

%add title
sgtitle(sprintf('Pixel Shift = %d, Contrast = %1.2f', pixel_shift,C))
%[text] - Run the code block repeatedly - what happens?
%[text] - Pay close attention to the max and minimum intensity frequencies.
%[text] - What is it called when an intensity in an image can't get any brighter?
%[text] - Change the additive to a negative and re-run \
%%
%[text] %[text:anchor:H_A767A386] ### Adjustment comparisons
%[text] The power of programming is the ability to automate your enhancement. Instead of just moving a slider around to explore different settings, you can create a for loop that does the exploring for you. 
%[text] Consider the following FOR LOOP, which adjusts an image 5 times.
%[text] We start with an adjusted image that has had 100 subtracted from every pixel intensity. We then add 50 to that adjusted image, display the image, display the histogram, and calculate the contrast. 
clf
offset = -100; % notice we set the offset before the for loop
num_cols = 5;

for n=1:num_cols
    i = img+offset;
    title_str = sprintf('offset: %d',offset);
    mmShowHist(i,n,num_cols,title_str)
    ylim([0 6e4])
    C = get_contrast(i); % see local function at bottom of script
    text(50,5.5e4,sprintf('C = %1.2f', C))
    
    % increase offset on each loop by 50
    offset = offset+50;
end
%%
%[text] %[text:anchor:H_723BE5CF] ## Bit Depth Considerations
%[text] Sometimes the lack of contrast in an image can be due to a mismatch between the bit depth of the image and the lookup table. Remember, the smallest bit depth that a variable can have is 8-bits. Everything goes up 8-bits from there: 8-bit, 16-bit, 32-bit, 64-bit, etc. The lookup tables used to display the images are based on this bit depth. So, for an 8-bit image, you'll have a 256 shades of gray. For a 16-bit image, 65,355 shades of gray. 
%[text] For example, considers what happens when we typecast our image to different classes
clf
nexttile; imshow(img); title('original'); colorbar
nexttile; imshow(uint16(img)); title('16-bit'); colorbar
nexttile; imshow(double(img)); title('double'); colorbar
%[text] note: 
%[text] - We have not changed the pixel intensities in the image.
%[text] - We simply changed the class of the variable
%[text] - Compare colorbars across the images \
%[text] 
%%
%[text] We can better see what's happening if we compare the histograms
figure
imgs = {img, uint16(img), double(img)}; % package images into a cell

for n=1:3
    subplot(2,3,n)
    imshow(imgs{n})
    title(class(imgs{n})) % title image with the variable class

    subplot(2,3,n+3)
    imhist(imgs{n})
end
impixelinfo
%[text] - notice as you move around the images, that there are pixel intensities — They are just not being shown correctly \
%[text] %[text:anchor:H_2409C8C8] ### Example: Low Dynamic Range
%[text] If the maximum pixel intensity in your image is much smaller than the class maxima, then your image is going to look underexposed. This is known as having a low dynamic range. 
clearvars
close all
mmSetUnitDataFolder(1)
img = imread("m51.tif");

figure(Visible="on")
imshow(img)
colorbar
impixelinfo
%[text] - Scrub around the image
%[text] - Are there any non-zero intensity values?
%[text] - Basically all of the non-zero pixels are falling in the black zone of the lookup table \
%%
%[text] What is the maximum pixel intensity in this image?
max_int = max(img(:))
%[text] 
%%
%[text] So, what is the bit depth?
log2(single(max_int)) % input must be a floating point
%[text] - log2 returns the power of 2 that would return the value inputted into the function \
%%
figure
mmShowHist(img)
title(sprintf('Max Pixel = %d',max(img(:))))
%%
%[text] Let's explore the image using imageViewer
imageViewer(img)
%[text] - Reject the request to adjust the contrast when asked
%[text] - Select the **contrast** tab and click on the Interactive Histogram \
%[text] ![](text:image:9b3c)
%[text] - In the interactive histogram, which appears below the image, drag the Right blue bar to the left \
%[text] ![](text:image:628a)
%[text] - Notice how the values in the Window Bounds section change
%[text] - See how the contrast improves (or worsens depending on the position of the blue handles \
%[text] Compare Ranges: Datatype vs Data Range
%[text] ![](text:image:77b7)
%%
%[text] %[text:anchor:H_99267B16] ### Image Normalization
%[text] One simple trick you can do when you have low dynamic range is to normalize the image. Normalize basically means to divide all of the intensities by the maximum intensity, so that the pixel intensities range from 0 to 1. A normalized image is converted to a double, so you can effectively have any number of shades of gray you want. 
%[text] The function **mat2gray** normalizes the image 
imgn = mat2gray(img);
figure
imshow(imgn)
impixelinfo
colorbar
fprintf('Max Pixel Intensity = %1.2f',max(imgn(:)))
%[text] - notice that ***`imgn`*** is a double
%[text] - Scrub around the image and notice that the pixel values are now fractions that fall between 0 and 1
%[text] - The maximum pixel intensity = 1 \
%%
%[text] %[text:anchor:H_7BAFF5AF] #### Histogram adjustment (imadjust)
%[text] For this image, normalizing made the brightest intensities visible.  But the contrast remains low because there are lot of intensity values that still fall in the black zone of the lookup table. 
%[text] Let's look at the histogram. 
figure
mmShowHist(imgn)
%[text] - notice where the majority of the pixel intensities are falling \
%%
%[text] %[text:anchor:H_CC154637] ### But wait, there's a better way
%[text] The function **imadjust** can stretch out the histogram to improve the dynamic range
imga = imadjust(imgn);

figure
imshow(imga)
%[text] - now we can see most of the details in the image \
%%
%[text] Let's compare the histograms from the two adjusted images
clf
mmShowHist(img,1,3,"original")
mmShowHist(imgn,2,3,"normalized")
mmShowHist(imga,3,3,"imadjust")
%[text] - imadjust stretches out histogram so that 1% of the values are saturated at low and high intensities
%[text] - Notice in the imadjust histogram, the blue lines touch both sides of the histogram: 0 and the max value \
%%
%[text] %[text:anchor:H_2FFFD1D3] #### Other Histogram adjusting techniques
%[text] The function **histeq** enhances contrast by binning the intensity values into an set number of bins across the histogram
clf
mmShowHist(imgn,1,3,"normalized")
mmShowHist(histeq(imgn,3), 2,3,"histeq 3 bins")
mmShowHist(histeq(imgn,30),3,3,"histeq 50 bins")
%[text] - Instead of a smoother distribution of pixels, the adjusted histograms has a limited set of bins (those sparse blue lines) and there only few set shades of gray \
%%
%[text] %[text:anchor:H_E3699E7C] #### Non-linear histogram adjustment (gamma)
%[text] %[text:anchor:H_6A779428] We can also adjust the histogram in a non-linear fashion
%[text] ![](text:image:5cd0)
%%
 imgg = imadjust(imgn,[],[],0.25); % adjust gamma

 clf
 imshow(imgg)
%%
%[text] %[text:anchor:H_B98FED12] #### GAMMA Histogram comparison 
%[text] Use more inputs into **imadjust** to change the gamma of the histogram
clf
gamma = [1 .05 0.1 0.5 1.1];
num_cols = numel(gamma);
for n=1:num_cols
    
    i = imadjust(imgn,[],[],gamma(n)); % adjust gamma
    title_str = sprintf('Gamma - %0.2f', gamma(n));
    mmShowHist(i,n,num_cols,title_str)

end
%[text] - A gamma of 1 is basically unchanged
%[text] - Notice the changes in the shape of the histogram
%[text] - Low gamma values shifts the histogram to the RIGHT
%[text] - High gamma values shifts the histogram to the LEFT \
%[text] **YOU TRY:** what would a gamma of 2 look like?
%%
%[text] %[text:anchor:H_26E4FE9B] ### Complement
%[text] The complement of an image is like its digital negative: High intensity are converted to low intensities and vice-versa. 
%[text] Here is the complement of the image
figure;
imshow(imcomplement(imga))
impixelinfo
%[text] - Scrub around the image
%[text] - Notice space is now near 255 while some of the craters are near zero \
%%
%[text] %[text:anchor:H_92471E0F] #### Complement comparison
% figure(Visible="on")
figure
num_cols = 2;

i = {imga,imcomplement(imga)}; % cell array of images
titles = ["original" "complement"];

for n=1:num_cols

    mmShowHist(i{n},n,num_cols,titles{n})
    ylim([0 5500]) % adjust y axis to highlight the intensity frequency outside of the background

end
%[text] - See how the histograms are mirror images of each other?
%[text] - Also, notice that the colormaps are the same (at the bottom of each histogram) \
%%
%[text] %[text:anchor:H_38658829] ### Complement math
%[text] The math for a complement image is fairly straightforward: You simply subtracting from the maximum possible value, inverting the negative
ar8bit = uint8([0 10 100 200 255])';

table(ar8bit, ...
    imcomplement(ar8bit),...
    255-ar8bit,...
    'VariableNames', {'original'; 'complement'; 'diff_255'})
%%
%[text] %[text:anchor:T_BADBBADA] # Neighborhood Processing and Filters 
%[text] Images can be enhanced using filters. Filters work by creating a small kernel (or neighborhood) that changes each pixel value based on the intensities of its neighbors.
%[text] ![](text:image:2e41)![](text:image:1ee0)
%[text] Gaussian Blur - Neighborhood processing    
%%
%[text] %[text:anchor:H_7881D574] ## Sharpening
%[text] Let's de-blur a blurry moon
clearvars -except imga
close all
mmSetUnitDataFolder(1)
blurry_moon = imread('blurry_moon.png');

figure
imshow(blurry_moon)
%%
%[text] %[text:anchor:H_9F436FEC] ## Sharpen 
%[text] Use the unsharp mask to remove blurry pixels
figure; 
i2 = imsharpen(blurry_moon, 'Radius', 1, 'Amount',15);
imshowpair(blurry_moon,i2,'montage') % creates a new image that places the two inputted images side by side (montage)
title('original | sharpened')
%[text] - you try it: adjust the radius and the amount \
%%
%[text] %[text:anchor:H_5C88AD3B] ### Average filter
%[text] To create and implement an average filter you use two functions: **fspecial** and **imfilter**
avg = fspecial("average",[3 3]);
moonAvg = imfilter(blurry_moon, avg,"symmetric");
imshowpair(blurry_moon, moonAvg,'montage')
title('original | average')
%[text] - the average filter has smooth out some of the bumps \
%%
%[text] %[text:anchor:H_1AE4C538] ## Gaussian Filter
%[text] Smears images - helps reduce noise
img_filt = imgaussfilt(blurry_moon, 3);
imshowpair(blurry_moon,img_filt,'montage')
title('original | gaussian blur', 'FontSize',16)
%[text] - try it yourself: change the second input into **imgaussfilt** \
%%
%[text] %[text:anchor:H_4C282A2F] ## Cleaning up Noise
%[text] The Median Filter is best used for cleaning up speckled noise. First we will add noise to the image using the **imnoise** function
img_nz = imnoise(imga,'salt & pepper');
figure
imshow(img_nz)
%%
%[text] Then we will clean up that noise using a median filter
img_median = medfilt2(img_nz);

clf
imshowpair(img_nz, img_median,'montage')
title('Noisy | Cleaned up')
%%
%[text] %[text:anchor:H_20C6A1A1] ## Uneven Background
%[text] The function **adapthisteq**  adjustes the histogram using kernel. This is known as Contrast-limited adaptive histogram equalization (CLAHE).
%[text] This is especially important for images with uneven background. 
%[text] Consider the following image
close all
clearvars
book = imread("book.png");
book = im2gray(book);

figure
imshow(book)
%[text] - There is extensive shadowing on the pages that affect the contrast of the text
%[text] - But there are some bright spots as well \
%%
%[text] Using the global histogram adjustments  doesn't quite fix the problem
% figure(Visible="on")
clf
tiledlayout("flow",TileSpacing="tight",Padding="tight");
i = {book,...
    imadjust(book),...
    histeq(book)};

title_str = ["Original" "imadjust" "histeq"];

for n=1:numel(i)
    nexttile
    imshow(i{n})
    title(title_str(n))
end
%[text] - there is still extensively shadowing throughout the pages \
%%
%[text] But the function **adapthisteq,** however, works quite nicely in this situation
i{end+1} = adapthisteq(book);
title_str(end+1) = 'adapthisteq';
nexttile
imshow(i{end})
title(title_str(end))
%[text] - in the adjusted image, most of the disruptive shadowing has been eliminated and the text can be clearly seen throughout the pages \
%%
%[text] Here we compare how the different contrast functions affect the image histograms
figure
num_cols = numel(i);
for n=1:num_cols
    mmShowHist(i{n},n,num_cols,title_str{n})
end
%%
%[text] %[text:anchor:T_0B186EE3] # Local Functions
function C=get_contrast(img)

% calculates Michelson contrast
Imax = double(max(img(:)));
Imin = double(min(img(:)));
C = (Imax-Imin) / (Imax+Imin); % contrast

end

